import axios from "axios";
const DbUrl2="https://isnft-prod.azurewebsites.net/api/houses";
export const gethouse = () => {
    axios
    .get(DbUrl2)
    .then(res=>{
        console.log(res.data);
    })
    .catch(er=>console.log(er));
}
